    /**
     * 5485. 找出最长的超赞子字符串
     *
     * 给你一个字符串 s 。请返回 s 中最长的 超赞子字符串 的长度。
     * 「超赞子字符串」需满足满足下述两个条件：
     * 该字符串是 s 的一个非空子字符串
     * 进行任意次数的字符交换后，该字符串可以变成一个回文字符串
     *  
     * 示例 1：
     * 输入：s = "3242415"
     * 输出：5
     * 解释："24241" 是最长的超赞子字符串，交换其中的字符后，可以得到回文 "24142"
     *
     * 示例 2：
     * 输入：s = "12345678"
     * 输出：1
     *
     * 示例 3：
     * 输入：s = "213123"
     * 输出：6
     * 解释："213123" 是最长的超赞子字符串，交换其中的字符后，可以得到回文 "231132"
     *
     * 示例 4：
     * 输入：s = "00"
     * 输出：2
     *  
     * 提示：
     * 1 <= s.length <= 10^5
     * s 仅由数字组成
     */
    fun longestAwesome(s: String): Int {
        for (i in 0 until s.length - 1) {
            if (j(s.substring(i, s.length))) {
                return s.length - i
            }
        }
        for (i in 0 until s.length - 1) {
            if (j(s.substring(0, s.length - i))) {
                return s.length - i
            }
        }
        return 1
    }

    fun j(s: String): Boolean {
        val hashMap = HashMap<Char, Int>()
        for (i in s) {
            if (hashMap.containsKey(i)) {
                hashMap[i] = hashMap[i]!! + 1
            } else {
                hashMap[i] = 1
            }
        }
        var hasSingle = false
        for (r in hashMap) {
            if (r.value % 2 != 0) {
                if (hasSingle) {
                    return false
                } else {
                    hasSingle = true
                }
            }
        }
        return true
    }
